import React from 'react'

const Jumbotron = () => {
    return (
        <div class="jumbotron jumbotron-fluid">
            <div class="container">
                <h1 class="display-4">L e t ' s   P l a y !</h1>
                <button type="button" class="btn btn-success">Success</button>
            </div>
        </div>
    )
}

export default Jumbotron
